SELECT M.Material,MB.Board,SC.[Date] AS DeliveryDate,CASE WHEN DATEPART(WEEKDAY,SC.Date) IN ({0},{1}) THEN 0 ELSE FLOOR(ISNULL(OpenQuantity,0)/{2}) END AS OpenQuantity 
FROM Sys_Calendar AS SC CROSS JOIN Sch_Materials AS M INNER JOIN Sch_MaterialBoards AS MB ON M.Material = MB.Material INNER JOIN Mfg_Boards AS B ON MB.Board = B.Board LEFT OUTER JOIN vw_Sch_WeeklyCustomerRequirements AS CR ON M.Material = CR.Material AND SC.[Week] = CR.[Week] 
WHERE (('{3}' BETWEEN StartProduction AND EndProduction) OR ('{4}' BETWEEN StartProduction AND EndProduction)) AND SC.Date BETWEEN '{3}' AND '{4}' AND M.Business = '{5}' AND B.Volume='{3}' ;

SELECT M.Material,M.Class,MB.Board,Bd.Class AS Tool,BD.Volume,Bd.ShiftCombination,Seconds,Operators,M.CustomerPN,M.Description,B.Family,M.Business,StdPack,ISNULL(PastDue,0) AS PastDue,ISNULL(CI.Quantity,0) AS Stock,StartProduction,EndProduction FROM Sch_Materials AS M INNER JOIN Sch_MaterialBoards AS MB ON M.Material = MB.Material INNER JOIN Mfg_Boards AS Bd ON MB.Board = Bd.Board  INNER JOIN Eng_1719Controls AS Cl ON M.Material = Cl.Material INNER JOIN Sch_Business AS B ON M.Business = B.Business LEFT OUTER JOIN vw_PastDue AS PD ON M.Material = PD.Material LEFT OUTER JOIN vw_CurrentInventory AS CI ON M.Material = CI.Material 
WHERE (('{0}' BETWEEN StartProduction AND EndProduction) OR ('{1}' BETWEEN StartProduction AND EndProduction)) AND B.Family = '{2}' AND Bd.Volume='{3}'
ORDER BY M.Material;

SELECT M.Material,MB.Board,SC.[Date] AS DeliveryDate,ISNULL(OpenQuantity,0) AS OpenQuantity 
FROM Sys_Calendar AS SC CROSS JOIN Sch_Materials AS M INNER JOIN Sch_MaterialBoards AS MB ON M.Material = MB.Material INNER JOIN Mfg_Boards AS B ON MB.Board = B.Board LEFT OUTER JOIN vw_Sch_DailyCustomerRequirements AS CR ON M.Material = CR.Material AND SC.[Date] = CR.DeliveryDate
WHERE (('{0}' BETWEEN StartProduction AND EndProduction) OR ('{1}' BETWEEN StartProduction AND EndProduction)) AND SC.[Date] BETWEEN '{0}' AND '{1}' AND M.Business = '{2}' AND B.Volume='{3}';
